def excel(data,name):
    a = []
    # 创建⼀个新的xlsx⽂件(如果原有同名⽂件会被覆盖)
    filename='C:/Users/WEIYI/Desktop/excel/'+name+".xlsx"
    book = xlsxwriter.Workbook(filename)
    # 创建⼀个新的表单，默认名称为 “sheet1”，输⼊字符参数可指定名称
    sheet1 = book.add_worksheet()
    # 字典数据
    # 循环字典key 的值
    for i in range(len(data)):
        title = [a for a in data[i]]
        # 循环把表头写入
        col1 = 0
        for t in title:
            sheet1.write(0, col1, t)
            col1 += 1
    row = 1
    col = 0
    for i in range(len(data)):
        col = 0
        for item in data[i]:
            sheet1.write(row, col, data[i][item])
            col += 1
        row += 1
    book.close()

